def get_profile(lat1, lon1, lat2, lon2, key, samples=100):
    url = "https://maps.googleapis.com/maps/api/elevation/json?" \
          f"path={lat1}%2C{lon1}%7C{lat2}%2C{lon2}&samples={samples}&key={key}"

    payload = {}
    headers = {}

    response = requests.request("GET", url, headers=headers, data=payload)

    if response.status_code == 200:
        return json.loads(response.text)
    else:
        return -1


def check_los(los_profile, start_hei, target_hei, start_name, target_name, distance, image=True, best_heights=False,
              max_start_hei=10000, max_target_hei=10000, min_start_hei=1, min_target_hei=1):
    """
    Checks if there is LoS between 2 points with certain height
    :param target_name: str, name of the target
    :param start_name: str, name of the start
    :param distance: float, distance of the link
    :param image: bool, if you want the image output or not
    :param best_heights: bool, if the height optimization needs to be done
    :param los_profile: dict, results as is from google elevation API
    :param start_hei:  float, start height
    :param target_hei: float, end height
    :param max_start_hei: float, maximum possible height start
    :param max_target_hei: float, maximum possible height target
    :param min_start_hei: float, minimum possible height start
    :param min_target_hei: float, minimum possible height target
    :return: plt plot if there is LoS else returns -1
    """
    # ecuation: y = mx + b

    los_profile = los_profile['results']
    elevation_list = []
    for tick in los_profile:
        elevation_list.append(tick['elevation'])

    resolution = len(elevation_list)
    elevation_list = np.array(elevation_list)

    start_hei = start_hei + elevation_list[0]
    target_hei = target_hei + elevation_list[-1]

    max_start_hei_ele = max_start_hei + elevation_list[0]
    max_target_hei_ele = max_target_hei + elevation_list[-1]

    b = start_hei
    height_dif = start_hei - target_hei
    m = -height_dif / resolution

    x = np.array(range(resolution))
    y = x * m + b
    # values to divide the distance in resolution steps
    x_labels = np.array(range(1, resolution+1)) * (distance / resolution)
    # we check if there is LoS

    los = all(y > elevation_list + 2)
    normal = (los, (start_hei - elevation_list[0], target_hei - elevation_list[0]))

    # ///////////////////////// Normalization of the terrain to find highest point \\\\\\\\\\\\\\\\\\\\\\\\\\\\\
    m_ptp = -(elevation_list[0] - elevation_list[-1]) / resolution  # We start always from the target distance is 0 to target
    x_ptp = x if m_ptp <= 0 else x[::-1] * -1  # We use X 0 2 Resolution if m <= 0>, else we invert it Resolution to 0
    b_ptp = elevation_list[0] if m_ptp <= 0 else elevation_list[-1]  # We change the starting point Y = depending on slope
    y_ptp = x_ptp * m_ptp + b_ptp  # We calculate the line between points
    y_norm = elevation_list - y_ptp
    max_hei_norm_ii = np.where(y_norm == np.amax(y_norm))[0][0]

    # ///////////////////////// Symmetrical link \\\\\\\\\\\\\\\\\\\\\\\\\\\\\
    y_sym_displace = (elevation_list[max_hei_norm_ii] - y[max_hei_norm_ii]) + 2  # displayment factor of the new line
    if y_sym_displace + start_hei <= max_start_hei_ele and y_sym_displace + target_hei <= max_target_hei_ele:
        # We will move the line only to the maximum height of both points
        y_sym = y + y_sym_displace  # y will only be moved by displacement factor
    elif max_start_hei < max_target_hei:  # if we need more hieght we will only move to the shortest of both points
        # we use max_start_height difference as displacement value
        y_sym_displace = max_start_hei - start_hei
        y_sym = y + y_sym_displace
    elif max_target_hei < max_start_hei:  # we use max_target_height as displacement value
        y_sym_displace = max_target_hei - target_hei
        y_sym = y + y_sym_displace
    else:
        y_sym = y_ptp
    if any(y_sym - elevation_list < 0):  # we need to change the slope as we have LoS starting from min height
        movement_max = min(max_start_hei, max_target_hei)
        movement_min = max(min_start_hei, min_target_hei)
        for i in range(movement_min, movement_max, 1):
            y_sym = y_ptp + i
            if all(y_sym > elevation_list + 2):
                break
    sym_start, sym_end = y_sym[0] - elevation_list[0], y_sym[-1] - elevation_list[-1]
    sym_los = all(y_sym > elevation_list)
    sym = (sym_los, (sym_start, sym_end))

    # ///////////////////////// Start stays the same link \\\\\\\\\\\\\\\\\\\\\\\\\\\\\
    # we calculate the distance from 0 to max height point to get the slope
    m_ss = -(start_hei - (elevation_list[max_hei_norm_ii] + 2)) / max_hei_norm_ii  # we add 2 meters to the height
    x_ss = x  # We always start from 0 to resolution.
    b_ss = start_hei
    y_ss = x_ss * m_ss + b_ss
    max_target_over = False
    # we check that target_height is below or equal to the maximum permitted
    if y_ss[-1] > max_target_hei_ele:
        # we need to correct the line to the new maximum value
        m_ss = -(start_hei - max_target_hei_ele) / resolution
        y_ss = x_ss * m_ss + b_ss
        max_target_over = True
    # We need to check the case where there is LoS and the highest terrain point does create a negative height.
    if any(y_ss - elevation_list < 0) and not max_target_over:  # we are below the ground level so we need to update the slope using target
        # we will iterate over the minimum height all the way to the maximum height in steps of 1 m and we will stop
        # when there is line of sight. Else we will calculate to the maximum height
        for i in range(min_target_hei, max_target_hei, 1):
            m_ss = -(start_hei - (elevation_list[-1] + i)) / resolution
            y_ss = x_ss * m_ss + b_ss
            if all(y_ss - (elevation_list + 2) > 0):
                break
    ss_start, ss_end = y_ss[0] - elevation_list[0], y_ss[-1] - elevation_list[-1]
    ss_los = all(y_ss > elevation_list)
    ss = (ss_los, (ss_start, ss_end))

    # ///////////////////////// Target stays the same link \\\\\\\\\\\\\\\\\\\\\\\\\\\\\
    # we calculate the distance from -100 to start point to get the slope
    # we change the symbol (-1) as we are looking in the other side
    m_ts = -((elevation_list[max_hei_norm_ii] + 2) - target_hei) / (resolution - max_hei_norm_ii)  # we add 2 meters to the height
    x_ts = x[::-1] * -1  # We always start from -100 to start.
    b_ts = target_hei
    y_ts = x_ts * m_ts + b_ts
    max_start_over = False
    # we check that start_height is below or equal to the maximum permitted
    if y_ts[0] > max_start_hei_ele:
        # we need to correct the line to the new maximum value
        m_ts = -(max_start_hei_ele - target_hei) / resolution
        y_ts = x_ts * m_ts + b_ts
        max_start_over = True
    # We need to check the case where there is LoS and the highest terrain point does create a negative height.
    if any(y_ts - elevation_list < 0) and not max_start_over:  # we are below the ground level so we need to update the slope using start
        # we will iterate over the minimum height all the way to the maximum height in steps of 1 m and we will stop
        # when there is line of sight. Else we will calculate to the maximum height
        for i in range(min_start_hei, max_start_hei, 1):
            m_ts = -((elevation_list[0] + i) - target_hei) / resolution
            y_ts = x_ts * m_ts + b_ts
            if all(y_ts - (elevation_list + 2) > 0):
                break
    ts_start, ts_end = y_ts[0] - elevation_list[0], y_ts[-1] - elevation_list[-1]
    ts_los = all(y_ts > elevation_list)
    ts = (ts_los, (ts_start, ts_end))

    if image:
        # create subplot
        f, ax = plt.subplots(figsize=(21, 16))
        # ax.legend(['Terrain profile', 'Wireless link']) # 'Min Sym Height', 'Fixed Start', 'Fixed Target'])
        # do the graphs with the modified range
        ax.plot(x_labels, elevation_list, color='brown', label='Terrain profile')
        ax.plot(x_labels, y, color='green', label='Wireless link')
        ax.plot(x_labels, y_sym, color='blue', label='Symmetrical link')
        ax.plot(x_labels, y_ss, color='orange', label='Start static')
        ax.plot(x_labels, y_ts, color='magenta', label='Target static')
        # draw highes point on graph
        ax.plot(x_labels[max_hei_norm_ii], elevation_list[max_hei_norm_ii], '-ro')

        # set title to the plot
        ax.set_title(f'Link {start_name} to {target_name}')
        # create vertical lines with tower height
        ax.vlines(x_labels[0], elevation_list[0], start_hei)
        ax.vlines(x_labels[-1], elevation_list[-1], target_hei)
        # set axes labels
        ax.set_ylabel('Height in m')
        ax.set_xlabel(f'{distance} km')
        # graph title
        ax.legend(loc="best")
        # adding info to the start tower
        tower_start = start_hei - elevation_list[0]
        y_start = tower_start / 2 + elevation_list[0]
        ax.text(x_labels[1], y_start, f'{round(tower_start,2)}m', color='green')
        # adding info to the end tower
        tower_end = target_hei - elevation_list[-1]
        y_target = tower_end / 2 + elevation_list[-1]
        ax.text(x_labels[-1], y_target, f'{round(tower_end,2)}m', color='green')
        # put a marker for the symmetrical link
        # start tower symmetrical link
        start_sym = y_sym[0] - elevation_list[0]
        ax.text(x_labels[1], y_sym[0], f'{round(start_sym,2)}m', color='blue')
        # target tower symmetrical link
        target_sym = y_sym[-1] - elevation_list[-1]
        ax.text(x_labels[-1], y_sym[-1], f'{round(target_sym,2)}m', color='blue')
        # put a marker for the start static
        # start tower static link
        start_st = y_ss[0] - elevation_list[0]
        ax.text(x_labels[1], y_ss[0], f'{round(start_st, 2)}m', color='orange')
        # target tower
        target_sym = y_ss[-1] - elevation_list[-1]
        ax.text(x_labels[-1], y_ss[-1], f'{round(target_sym, 2)}m', color='orange')
        # Put marker for the target static
        # start tower
        start_ts = y_ts[0] - elevation_list[0]
        ax.text(x_labels[1], y_ts[0], f'{round(start_ts, 2)}m', color='magenta')
        # target tower
        target_ts = y_ts[-1] - elevation_list[-1]
        ax.text(x_labels[-1], y_ts[-1], f'{round(target_ts, 2)}m', color='magenta')

        # add table with data
        labels_cols = ['Start', 'Distance', 'End']
        labels_rows = ['Name', 'Lat', 'Lon', 'Tower height', 'Symmetrical', 'Start static',
                       'Target static', 'Terrain height', 'Az.']
        az_t2e = calculate_azimuth(los_profile[0]["location"]["lat"], los_profile[0]["location"]["lng"],
                                   los_profile[-1]["location"]["lat"], los_profile[-1]["location"]["lng"])
        az_e2t = calculate_azimuth(los_profile[-1]["location"]["lat"], los_profile[-1]["location"]["lng"],
                                   los_profile[0]["location"]["lat"], los_profile[0]["location"]["lng"])
        data = [
            [f'{start_name}', f'{distance} km', f'{target_name}'],
            [f'{los_profile[0]["location"]["lat"]}°', '', f'{los_profile[-1]["location"]["lat"]}°'],
            [f'{los_profile[0]["location"]["lng"]}°', '', f'{los_profile[-1]["location"]["lng"]}°'],
            [f'{round(tower_start,2)} m / {max_start_hei}m max', f'{"LoS" if los else "No LoS"}',
             f'{round(tower_end,2)} m / {max_target_hei}m max'],
            [f'{round(sym_start,2)} m / {max_start_hei}m max', f'{"LoS" if sym_los else "No LoS"}',
             f'{round(sym_end,2)} m / {max_target_hei}m max'],
            [f'{round(ss_start, 2)} m / {max_start_hei}m max', f'{"LoS" if ss_los else "No LoS"}',
             f'{round(ss_end, 2)} m / {max_target_hei}m max'],
            [f'{round(ts_start, 2)} m / {max_start_hei}m max', f'{"LoS" if ts_los else "No LoS"}',
             f'{round(ts_end, 2)} m / {max_target_hei}m max'],
            [f'{elevation_list[0]}', '', f'{elevation_list[-1]}'],
            [f'{az_t2e}°', '', f'{az_e2t}°']
        ]

        plt.table(cellText=data, rowLabels=labels_rows, colLabels=labels_cols, loc='bottom', cellLoc='center',
                  bbox=(0, -0.35, 1, 0.25))
        f.tight_layout()
    image = (f, ax) if image else None
    return (normal, sym, ss, ts), image


def save_graph(filename, list_graph, single=True):
    if single:
        fig = list_graph[0][0]
        fig.savefig(filename)
    else:
        with PdfPages(filename) as pdf:
            for graph in list_graph:
                pdf.savefig(graph[0])


